import { put, takeEvery } from 'redux-saga/effects';
import * as actions from '../actions';
import SwipeImage from '../components/assets/img/icons/wiping-swipe-for-floors.svg';
import BellImage from '../components/assets/img/icons/bell1.svg';
import ForkImage from '../components/assets/img/icons/plate-fork-and-knife.svg';
import FileImage from '../components/assets/img/icons/file.svg';

export function* ServiceData() {
    console.log("submit------services");
    yield put(actions.ServiceData.request());
    try {
        console.log("SUCCESS-SAGA_DASHBOARD")
        let objArray = [
            { id: 1, serviceName: "FrontOffice", subText: "Requests, Wifi and More", icon: SwipeImage , link: `frontoffice` },
            { id: 2, serviceName: "HouseKeeping", subText: "Cleaning, Dusting and More", icon: BellImage ,  link:  `dashboard`},
            { id: 3, serviceName: "All Day Dining",subText: "Breakfast, Brunch, Lunch", icon: ForkImage,  link: `services` },
            { id: 4, serviceName: "Bed, Bath & More", subText: "Towel, Shampoo, Dental Kit..", icon: FileImage , link: `dashboard`},
            { id: 5, serviceName: "Other Services", subText: "Towel, Shampoo, Dental Kit..", icon: FileImage , link: `dashboard` }
        ]
        // const response = [{ id: 1, serviceName: FrontOffice },]
        yield put(actions.ServiceData.success(objArray));
    } catch ({ error }) {
        yield put(actions.ServiceData.read.failure(error));
    }
}

export function* watchServiceData() {
    yield takeEvery(actions.LOAD_SERVICE, ServiceData);
}

export default watchServiceData
